import React, { useEffect, useState } from 'react';
import { useNavigate, useParams } from 'react-router-dom';
import api from './api'; // Your axios setup file

const ManageCourses = ({ mode }) => {
  const [courses, setCourses] = useState([]);
  const [newCourse, setNewCourse] = useState({ name: '', description: '' });
  const [editData, setEditData] = useState({ name: '', description: '' });
  const [editingCourseId, setEditingCourseId] = useState(null);
  const { courseId } = useParams();
  const navigate = useNavigate();

  const fetchCourses = async () => {
    const res = await api.get('/admin/courses');
    setCourses(res.data);
  };

  useEffect(() => {
    fetchCourses();
  }, []);

  useEffect(() => {
    if (mode === 'edit' && courseId) {
      const fetch = async () => {
        try {
          const res = await api.get(`/admin/courses/${courseId}`);
          setEditData({ name: res.data.name, description: res.data.description });
          setEditingCourseId(courseId);
        } catch (err) {
          console.error('Failed to fetch course', err);
        }
      };
      fetch();
    }
  }, [mode, courseId]);

  const handleAdd = async (e) => {
    e.preventDefault();
    await api.post('/admin/courses', newCourse);
    setNewCourse({ name: '', description: '' });
    fetchCourses();
    navigate('/admin/courses');
  };

  const handleUpdate = async (e) => {
    e.preventDefault();
    await api.put(`/admin/courses/${editingCourseId}`, editData);
    setEditData({ name: '', description: '' });
    setEditingCourseId(null);
    fetchCourses();
    navigate('/admin/courses');
  };

  const handleDelete = async (id) => {
    await api.delete(`/admin/courses/${id}`);
    fetchCourses();
  };

  if (mode === 'add') {
    return (
      <div>
        <h2>Add Course</h2>
        <form onSubmit={handleAdd}>
          <input
            value={newCourse.name}
            onChange={(e) => setNewCourse({ ...newCourse, name: e.target.value })}
            placeholder="Course Name"
            required
          />
          <input
            value={newCourse.description}
            onChange={(e) => setNewCourse({ ...newCourse, description: e.target.value })}
            placeholder="Description"
            required
          />
          <button type="submit">Add</button>
          <button onClick={() => navigate('/admin/courses')}>Cancel</button>
        </form>
      </div>
    );
  }

  if (mode === 'edit') {
    return (
      <div>
        <h2>Edit Course</h2>
        <form onSubmit={handleUpdate}>
          <input
            value={editData.name}
            onChange={(e) => setEditData({ ...editData, name: e.target.value })}
            placeholder="Course Name"
            required
          />
          <input
            value={editData.description}
            onChange={(e) => setEditData({ ...editData, description: e.target.value })}
            placeholder="Description"
            required
          />
          <button type="submit">Update</button>
          <button onClick={() => navigate('/admin/courses')}>Cancel</button>
        </form>
      </div>
    );
  }

  return (
    <div>
      <h2>Manage Courses</h2>
      <button onClick={() => navigate('/admin/courses/add')}>Add New Course</button>
      <ul>
        {courses.map((course) => (
          <li key={course._id}>
            <strong>{course.name}</strong> - {course.description}
            <button onClick={() => navigate(`/admin/courses/edit/${course._id}`)}>Edit</button>
            <button onClick={() => handleDelete(course._id)}>Delete</button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ManageCourses;
